import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

// Create a Logo component
function Logo() {
  return (
    <div className="logo-container">
      <img className="logo" src={logo} alt="Logo" />
    </div>
  );
}

// Create a TopLink component
function TopLink() {
  const [hovered, setHovered] = useState(false);

  const handleLinkHover = () => {
    setHovered(true);
  };

  const handleLinkLeave = () => {
    setHovered(false);
  };

  return (
    <span className={`top-link ${hovered ? 'top-link-hovered' : ''}`}>
      <Link to="/about" onMouseEnter={handleLinkHover} onMouseLeave={handleLinkLeave}>
        work
      </Link>
    </span>
  );
}

function Footer() {
  return (
    <footer className="footer">
      &copy; 2023 Gon√ßalo Barroso
    </footer>
  );
}

function ObjectImage(object) {
  return (
    <button className="object-button">
      <img
        className="object"
        src={`${object % 4}.svg`}
        alt="object"
        onClick={handleClick}
      />
    </button>
  );
}

export default function HomePage() {
  const [object, setObject] = useState(0);

  const handleClick = () => {
    setObject(object + 1);
  }

  return (
    <div className="home">
      <Logo />
      <TopLink />
      <Footer />
      <ObjectImage object={object}/>
    </div>
  );
}
